import React from "react";
import { useLocation } from "react-router-dom";
import "../style/App.css";

function JobResults() {
  const location = useLocation();
  const form = location.state?.form;

  return (
    <div className="container">
      <h2>Job Results</h2>
      {form ? (
        <div>
          <p><b>Qualification:</b> {form.qualification}</p>
          <p><b>Location:</b> {form.location}</p>
          <p><b>Job Role:</b> {form.jobRole}</p>
          <p><b>Preferred Time:</b> {form.time}</p>
          <p><b>Salary Expectation:</b> {form.salary}</p>
          <p><b>Night Shift:</b> {form.nightShift}</p>
        </div>
      ) : (
        <p>No job search submitted yet.</p>
      )}
    </div>
  );
}

export default JobResults;
